import React, { Component } from 'react';

class Tracks extends Component {
    render() {

        let topten = [];
        let response = this.props.response;

        if(response !==null){
            for(let i=0 ; i<10 ; i++){
                topten.push(response.data.data[i]);
            }
    
            topten.forEach(function(item,index){
                console.log(item,index);
                let songname = item.title_short;
                console.log(songname,item.album.id);
            });
        }

        return (
            <div>
               {
                   topten.map(item => {
                        return (
                            <div key={item.rank}>
                                <div className="row">
                                    <div className="col s12 m4">
                                        <div className="card">
                                            <div className="card-image">
                                                <img src={item.album.cover_medium} alt=""/>
                                                <span>{item.title_short}</span>
                                            </div>
                                            <div className="card-content">
                                                <p>Album Title : {item.album.title}</p>
                                                <p>Title : {item.title}</p>
                                                <p>Song Rank : {item.rank}</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        );
                    })
               }
            </div>
        )
    }
}

export default Tracks
